import logo from './logo.svg';
import './App.scss';
import Home from './Home'
import DarkMode from './Navbar/darkMode';
import Navbar from './Navbar';


function App(props) {

 function alerta (){
  alert('ok')
 }

  return (

    <div className="App">


      <Navbar> <DarkMode onClick={alerta}/> </Navbar>
      
      <Home/>
      

    </div>
  );
}
export default App;
